import Card from "./Card"

import { Switch, Route, useRouteMatch, Router } from 'react-router-dom';

function CardContainer({ recipes }) {
    let match = useRouteMatch();

    let testReturn = recipes.map(recipe => {
                return (
                    <Route
                    path={`${match.url}${recipe.id}`} key={recipe.id} element={<Card recipe={recipe}/>}>
                    </Route>
                )
            })

    return (
        <div id="cards-container">
            {/* <Route> */}
                {testReturn}
            {/* </Route> */}
            {recipes.map(recipe => {
                return (
                    <Card key={recipe.id} recipe={recipe}/>
                )
            })}
        </div>
    )
}

export default CardContainer
